import React, { Component } from 'react';

class ListNews extends Component {

    render() { 
        const { content } = this.props;

        return ( 
            
            <div className="news_list">
                {content.map(eachnews =>
                    <div className>
                    <div key={eachnews.id} >
                        { eachnews['headline'] }
                        </div>
                    </div>
                  )}
                
            </div>
         );
    }
}
 
export default ListNews;
